import React, { useState } from "react";

const OnTypeEx = (props) => {
   let str = "This text shoule change";
   const OnType = (event) => {
      const [textField, setTextField] = useState(str);
      setTextField("Changed");
      console.log(event);
   };
   <form>
      <input onType={textField}></input>
      <p></p>
   </form>;
};

export default OnTypeEx;
